import { GoogleMap, useLoadScript, Marker } from '@react-google-maps/api';
import {useState, useEffect} from "react";


const center = {lat:1.3046688076702777, lng: 103.80008079564587}
const Maps = () => {
    const [kiosks, setKiosks] = useState(null)

    useEffect(() => {
        fetch('https://asia-southeast1-total-dreamer-297509.cloudfunctions.net/generate-latlong/coordinates')
          .then(res => {
            return res.json();
          })
          .then(data => {
            setKiosks(data);
          })
      }, [])
    
    
    const {isLoaded} = useLoadScript({
        googleMapsApiKey: "AIzaSyCUvExdvtB4lKu2IJjTfBka8254ImunKnk",
    });

    if(!isLoaded) return <div>Loading...</div>;
    return ( 
        <div>
            {kiosks.map(kiosk => (
                <div>
                <h2>{kiosk.name}</h2>
                <h2>{kiosk.latitude}</h2>
                <h2>{kiosk.longitude}</h2>
                </div>
            ))}
        </div>


        
     );
}
 
export default Maps;
